import React from 'react';

import NewsSlider from '../widgets/NewsSlider/slider';
import NewsList from '../widgets/NewsList/newsList';

const Home = () =>{
    return(
        <div>
            <NewsSlider
                type="featured"
                country={'ca'}
                city={''}
                category={'health'}
                amount={5}
                setting={{
                    dots:true
                }}
            />
            <NewsList
                type="detail"
                country={'ca'}
                city={''}
                category={'business'}
                amount={10}
                loadmore={true}
            />
            <VideoList
                type="card"
                title={true}
                loadmode={false}
                amount={5}
            />

        </div>
    )
}

export default Home;
